import './highlights.scss';
const HighlightPage = () => {
    const [highlightInfo, SetHighlightInfo] = useState('');
    const router = useRouter();
    const {category} = router.query;
    useEffect(() => {
        axios.get("http://192.168.137.1:8080/tipboard", {
            params: {
                pageNum: 1,
                way: voteCount,
                category: category
            }
        })
        .then(response => {
            SetHighlightInfo(response.data);
        })
        .catch(error => {
            console.log(error)
        })
    })
